import React, { useState, useEffect } from 'react';
import { useAuth } from '../../context/AuthContext';
import api from '../../services/api';

const AvailableQuizzes = () => {
    const { user } = useAuth();
    const [quizzes, setQuizzes] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        fetchAvailableQuizzes();
    }, []);

    const fetchAvailableQuizzes = async () => {
        try {
            console.log('AvailableQuizzes - Fetching available quizzes for student...');
            setLoading(true);
            const response = await api.get('/quizzes/available');
            console.log('AvailableQuizzes - Quizzes fetched:', response.data);
            setQuizzes(response.data.quizzes || []);
            setError('');
        } catch (err) {
            console.error('AvailableQuizzes - Error fetching quizzes:', err);
            setError(err.response?.data?.message || 'Failed to fetch available quizzes');
        } finally {
            setLoading(false);
        }
    };

    const startQuiz = async (quizId) => {
        try {
            console.log(`AvailableQuizzes - Starting quiz ${quizId}`);
            const response = await api.post('/submissions/start', { quizId });
            console.log('AvailableQuizzes - Quiz started:', response.data);

            // Redirect to quiz taking page or show success message
            alert('Quiz started successfully! You can now take the quiz.');

            // Refresh the list to update status
            fetchAvailableQuizzes();
        } catch (err) {
            console.error('AvailableQuizzes - Error starting quiz:', err);
            alert(err.response?.data?.message || 'Failed to start quiz');
        }
    };

    const formatDate = (dateString) => {
        if (!dateString) return 'No deadline';
        return new Date(dateString).toLocaleString();
    };

    const getQuizStatus = (quiz) => {
        if (quiz.is_completed) return 'Completed';
        if (quiz.is_started) return 'In Progress';
        if (quiz.deadline && new Date(quiz.deadline) < new Date()) return 'Expired';
        return 'Available';
    };

    const getStatusBadgeClass = (status) => {
        switch (status) {
            case 'Available': return 'bg-success';
            case 'In Progress': return 'bg-warning';
            case 'Completed': return 'bg-info';
            case 'Expired': return 'bg-danger';
            default: return 'bg-secondary';
        }
    };

    const canStartQuiz = (quiz) => {
        const status = getQuizStatus(quiz);
        return status === 'Available' && !quiz.is_started && !quiz.is_completed;
    };

    const canContinueQuiz = (quiz) => {
        const status = getQuizStatus(quiz);
        return status === 'In Progress' && quiz.is_started && !quiz.is_completed;
    };

    if (loading) {
        return (
            <div className="container mt-4">
                <div className="d-flex justify-content-center">
                    <div className="spinner-border text-primary" role="status">
                        <span className="visually-hidden">Loading...</span>
                    </div>
                </div>
            </div>
        );
    }

    return (
        <div className="container mt-4">
            <div className="d-flex justify-content-between align-items-center mb-4">
                <h2>Available Quizzes</h2>
                <button className="btn btn-primary" onClick={fetchAvailableQuizzes}>
                    <i className="fas fa-sync-alt me-2"></i>
                    Refresh
                </button>
            </div>

            {error && (
                <div className="alert alert-danger alert-dismissible fade show" role="alert">
                    <i className="fas fa-exclamation-triangle me-2"></i>
                    {error}
                    <button type="button" className="btn-close" onClick={() => setError('')}></button>
                </div>
            )}

            {quizzes.length === 0 ? (
                <div className="alert alert-info">
                    <i className="fas fa-info-circle me-2"></i>
                    No quizzes available at this time.
                </div>
            ) : (
                <div className="row">
                    {quizzes.map(quiz => {
                        const status = getQuizStatus(quiz);
                        return (
                            <div key={quiz.id} className="col-md-6 col-lg-4 mb-4">
                                <div className="card h-100">
                                    <div className="card-header d-flex justify-content-between align-items-center">
                                        <h5 className="mb-0">{quiz.title}</h5>
                                        <span className={`badge ${getStatusBadgeClass(status)}`}>
                                            {status}
                                        </span>
                                    </div>
                                    <div className="card-body">
                                        <p className="card-text text-muted">{quiz.description}</p>

                                        <div className="mb-3">
                                            <small className="text-muted">
                                                <i className="fas fa-chalkboard-teacher me-1"></i>
                                                <strong>Class:</strong> {quiz.class_name}
                                            </small>
                                        </div>

                                        <div className="row text-center mb-3">
                                            <div className="col-4">
                                                <small className="text-muted">Questions</small>
                                                <div className="fw-bold">{quiz.question_count || 0}</div>
                                            </div>
                                            <div className="col-4">
                                                <small className="text-muted">Time Limit</small>
                                                <div className="fw-bold">
                                                    {quiz.time_limit_minutes ? `${quiz.time_limit_minutes} min` : 'No limit'}
                                                </div>
                                            </div>
                                            <div className="col-4">
                                                <small className="text-muted">Max Score</small>
                                                <div className="fw-bold">{quiz.max_score || 0}</div>
                                            </div>
                                        </div>

                                        <div className="mb-3">
                                            <small className="text-muted">
                                                <i className="fas fa-clock me-1"></i>
                                                <strong>Deadline:</strong> {formatDate(quiz.deadline)}
                                            </small>
                                        </div>

                                        {quiz.is_completed && (
                                            <div className="mb-3">
                                                <small className="text-success">
                                                    <i className="fas fa-check-circle me-1"></i>
                                                    <strong>Your Score:</strong> {quiz.user_score || 0}/{quiz.max_score || 0}
                                                </small>
                                            </div>
                                        )}
                                    </div>
                                    <div className="card-footer">
                                        {canStartQuiz(quiz) && (
                                            <button 
                                                className="btn btn-success w-100"
                                                onClick={() => startQuiz(quiz.id)}
                                            >
                                                <i className="fas fa-play me-2"></i>
                                                Start Quiz
                                            </button>
                                        )}
                                        {canContinueQuiz(quiz) && (
                                            <button 
                                                className="btn btn-warning w-100"
                                                onClick={() => startQuiz(quiz.id)}
                                            >
                                                <i className="fas fa-play me-2"></i>
                                                Continue Quiz
                                            </button>
                                        )}
                                        {status === 'Completed' && (
                                            <button className="btn btn-info w-100" disabled>
                                                <i className="fas fa-check me-2"></i>
                                                Quiz Completed
                                            </button>
                                        )}
                                        {status === 'Expired' && (
                                            <button className="btn btn-danger w-100" disabled>
                                                <i className="fas fa-times me-2"></i>
                                                Quiz Expired
                                            </button>
                                        )}
                                    </div>
                                </div>
                            </div>
                        );
                    })}
                </div>
            )}
        </div>
    );
};

export default AvailableQuizzes;
